EN:
[OnSucceedAttack] &lt;style="highlight"&gt;If Charge Count was spent, inflict 3 [DimensionRift]&lt;/style&gt;

KR:
가장 뒤에 있는 대상 공격 (일반 전투 한정)

[BeforeAttack] 충전 횟수를 소모하고 소모한만큼 피해량이 증가함 (최대 75%)&lt;style="highlight"&gt;&lt;/style&gt;
EN:
Targets the rearmost unit (In regular encounters)

[BeforeAttack] Spend Charge Count to deal more damage (Max 75%)&lt;style="highlight"&gt;&lt;/style&gt;

KR:
[OnSucceedAttack] 피해량의 (대상의 파열 X 10)% 만큼 오만 추가 피해를 주고, 파열 횟수 5 소모 (최대 100%)&lt;style="highlight"&gt;&lt;/style&gt;
EN:
[OnSucceedAttack] Deal bonus Pride damage by (Target’s Rupture x 10)% of the damage dealt, and reduce Rupture Count by 5 (Max 100)&lt;style="highlight"&gt;&lt;/style&gt;

